// Write the functionality and export it
// Lowecase tags are built in HTML. UpperCase is custom components
import './ExpenseItem.css'
// Import css file to make the bundler link them

function ExpenseItem() {
  return (
    <div className = "expense-item"> {/*Note not class, but className, different in JSX*/}
      <div>13 December 2020</div>
      <div className = "expense-item__description">
        <h2>Home Insurance</h2>
        <div className = "expense-item__price">$250</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
